	const { isLogin } = useSelector((state) => state.UserDataReducer);

	return (
		<ComponnentWrapper>
			{isLogin ? <CvIntro /> : <CvList />}
		</ComponnentWrapper>
	);
}

const ComponnentWrapper = styled.div``;

export default Cvpage;
